-- CREATE TABLE "users" ------------------------------------
-- CREATE TABLE "users" ----------------------------------------
CREATE TABLE `users` ( 
	`id` Int( 10 ) UNSIGNED AUTO_INCREMENT NOT NULL,
	`createDate` Timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
	`isSubscribed` TinyInt( 1 ) UNSIGNED NOT NULL DEFAULT '0',
	`updateDate` Timestamp NULL,
	`updateExp` Timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
	`accountType` TinyInt( 1 ) NULL DEFAULT '0' COMMENT 'Basic, Full',
	`birthdayDate` DateTime NULL,
	`alias` VarChar( 64 ) CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
	`name` VarChar( 16 ) CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
	`password` VarChar( 48 ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'Salt:8 + SHA1(Salt + Password):40',
	`token` VarChar( 32 ) CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'Auth cookie token',
	`role` VarChar( 16 ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'user' COMMENT 'ACL role',
	`email` VarChar( 128 ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
	`email2` VarChar( 128 ) CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
	`firstName` VarChar( 32 ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
	`lastName` VarChar( 32 ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
	`gender` Set( 'M', 'F' ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'M',
	`address` VarChar( 128 ) CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
	`city` VarChar( 64 ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
	`state` VarChar( 64 ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
	`zip` VarChar( 24 ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
	`country` VarChar( 64 ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
	`phone` VarChar( 32 ) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
	`websites` Text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'serialize array socials',
	`professionalHeadline` VarChar( 128 ) CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '(Posada)',
	`industry` Int( 4 ) NULL COMMENT '(Sfera dijalnosti)',
	`summaryText` Text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
	`summaryLinks` Text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'serialize',
	`maritalStatus` TinyInt( 1 ) NULL,
	`interests` Text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
	`personalDetails` Text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
	`countConnections` Int( 7 ) NOT NULL DEFAULT '0',
	`countConnections2` Int( 7 ) NOT NULL DEFAULT '0',
	`countConnections3` Int( 7 ) NOT NULL DEFAULT '0',
	`shareActivityInActivityFeed` TinyInt( 1 ) NOT NULL DEFAULT '1' COMMENT '(Yes, No)',
	`setInvisibleProfile` TinyInt( 1 ) NOT NULL DEFAULT '0' COMMENT '(Yes, No)',
	`whoCanSeeActivity` TinyInt( 1 ) NOT NULL DEFAULT '1' COMMENT '(All, Me, My Connections, My network)',
	`whoCanSeeConnections` TinyInt( 1 ) NOT NULL DEFAULT '1' COMMENT '(All, Me, My Connections, My network)',
	`whoCanSeeContactInfo` TinyInt( 1 ) NOT NULL DEFAULT '2' COMMENT '(All, Me, My Connections, My network)',
	`avaToken` VarChar( 16 ) CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
	`isConfirmed` TinyInt( 1 ) NOT NULL DEFAULT '1',
	`isInvisible` TinyInt( 1 ) NOT NULL DEFAULT '0',
	`isRemoved` TinyInt( 1 ) NOT NULL DEFAULT '0',
	`isUpdatedConnections` TinyInt( 1 ) NOT NULL DEFAULT '0',
	`isBlocked` TinyInt( 1 ) NOT NULL DEFAULT '0',
	PRIMARY KEY ( `id` ),
	CONSTRAINT `email_idx_1` UNIQUE( `email` ),
	CONSTRAINT `name_idx_1` UNIQUE( `name` ) )
CHARACTER SET = utf8
COLLATE = utf8_general_ci
ENGINE = InnoDB
AUTO_INCREMENT = 446;
